const InjuryList = ({ injury, title }) => {
  // const injury = props.injury;
  // const title = props.title;
  // console.log(injury);

  return (
    <div className="injury-list">
      <h2>{title}</h2>
      {injury.map((blog) => (
        <div className="blog-preview" key={blog.id}>
          <h2>{blog.title}</h2>
          <p>Written by {blog.author}</p>
        </div>
      ))}
    </div>
  );
};

export default InjuryList;
